@jackylk Both solutions have pros and cons, both are alternate solutions only.
In case of loading data from hive or orc or parquet etc.. to carbondata, we can use the respective InputFormats to load data to carbondata instead of using dataframe if there is no transformation involved.
But if the transformation is involved before loading to carbondata then executing dataframe twice may take very long time depends upon the transformation cost.
Each solution can solve some set of problems but both are not perfect solutions. I think the better solution is to make the data loading single pass.
@QiangCai  Can you move this discussion to dev mailing list with current opinions.

@QiangCai carbon can not load two huge data one time currently , for example load 10 billion records one time .
So we seperate the input CSV to multi part , and load multi times to work around .
